Mick Blue is secretly in love with the beautiful Kayden Kross, his roommate. One night she kicks Mick and his buddies out of the house so she can party with her hot girlfriends and have a &quot;ladies night&quot;. Mick, desperate for her sexual attention, gets talked into crashing Kayden's little naughty party by dressing up as a girl. Horny stud, Scott Nails, decides to dress up with Mick and sneak in. All insanity breaks loose as the boys get busy with one girl after another. Kayden catches Scott doing it hard with Loni Evans while Manuel Ferrera, the pizza guy, gets nasty with one of the sexy, hot chicks, too. Room by room, Kayden Kross and her sexy friends turn their party into a wild, fun-filled sex-travaganza! Kayden makes Mick's fantasies come true when she realizes he's the man to fulfill her lusty desires.
